import ReactDOM from 'react-dom/client';

const App = <div className="learn-logs">
    <div className="item">
        {/** date */}
        <dic className="date">
            <div className="month">July</div>
            <div className="day">01</div>
        </dic>
        {/** content */}
        <dic className="content">
            <h2 className="desc">

            </h2>
        </dic>
    </div>
    <h1>This is first React Project</h1>
</div>;

const root = ReactDOM.createRoot(document.querySelector('#root'));
root.render(App);

export default App;
